using MultiPrecision;

namespace OwensT {
    internal static class OwenTPatefieldTandyAlgo<N> where N: struct, IConstant {
        public static MultiPrecision<N> T1(MultiPrecision<N> h, MultiPrecision<N> a, int max_terms = 4096) { 
            MultiPrecision<N> h2 = h * h, a2 = a * a;

            MultiPrecision<N> n_half_h2 = -h2 / 2;

            MultiPrecision<N> ap = a / (2 * MultiPrecision<N>.PI);
            MultiPrecision<N> c = MultiPrecision<N>.Expm1(n_half_h2);
            MultiPrecision<N> b = n_half_h2 * MultiPrecision<N>.Exp(n_half_h2);
            MultiPrecision<N> s = MultiPrecision<N>.Atan(a) / (2 * MultiPrecision<N>.PI);

            for (int k = 1, conv_times = 0; k <= max_terms && conv_times < 2 && s.IsFinite; k++) {
                MultiPrecision<N> u = c * ap / (2 * k - 1);
                    
                s += u;
                ap *= a2;
                c = b - c;
                b *= n_half_h2 / (k + 1);

                if (u.Exponent < s.Exponent - MultiPrecision<N>.Bits) {
                    conv_times++;
                }
                else {
                    conv_times = 0;
                }
                if (k >= max_terms) {
                    return MultiPrecision<N>.NaN;
                }
            }

            return s;
        }

        public static MultiPrecision<N> T2(MultiPrecision<N> h, MultiPrecision<N> a, int max_terms = 4096) {
            MultiPrecision<N> h2 = h * h, na2 = -a * a, ha = h * a;
                
            MultiPrecision<N> v = 1d / h2;
            MultiPrecision<N> w = a * MultiPrecision<N>.Exp(-ha * ha / 2) / MultiPrecision<N>.Sqrt(2 * MultiPrecision<N>.PI);
            MultiPrecision<N> u = MultiPrecision<N>.Erf(ha / MultiPrecision<N>.Sqrt2) / (2 * h);
            MultiPrecision<N> s = u;

            for (int k = 0, conv_times = 0; k <= max_terms && conv_times < 2 && s.IsFinite; k++) {
                u = v * (w - (2 * k + 1) * u);
                s += u;
                w *= na2;

                if (u.Exponent < s.Exponent - MultiPrecision<N>.Bits) {
                    conv_times++;
                }
                else {
                    conv_times = 0;
                }
                if (k >= max_terms) {
                    return MultiPrecision<N>.NaN;
                }
            }

            MultiPrecision<N> y = s * MultiPrecision<N>.Exp(-h2 / 2) / MultiPrecision<N>.Sqrt(2 * MultiPrecision<N>.PI);

            return y;
        }

        public static MultiPrecision<N> T4(MultiPrecision<N> h, MultiPrecision<N> a, int max_terms = 4096) {
            MultiPrecision<N> h2 = h * h, na2 = -a * a;
                
            MultiPrecision<N> v = a * MultiPrecision<N>.Exp(h2 * (na2 - 1d) / 2) / (2 * MultiPrecision<N>.PI);
            MultiPrecision<N> w = 1d;
            MultiPrecision<N> s = v;

            for (int k = 0, conv_times = 0; k < max_terms && conv_times < 2 && s.IsFinite; k++) {
                w = (1d - h2 * w) / (2 * k + 3);
                v *= na2;

                MultiPrecision<N> u = v * w;
                s += u;

                if (u.Exponent < s.Exponent - MultiPrecision<N>.Bits) {
                    conv_times++;
                }
                else {
                    conv_times = 0;
                }
                if (k >= max_terms - 1) {
                    return MultiPrecision<N>.NaN;
                }
            }

            return s;
        }

        public static MultiPrecision<N> T5(MultiPrecision<N> h, MultiPrecision<N> a) {
            MultiPrecision<N> h2 = h * h, a2 = a * a;

            MultiPrecision<N> n_half_h2 = -h2 / 2;

            MultiPrecision<N> s = 0;

            for (int k = 0; k < gls.Length; k++) { 
                MultiPrecision<N> r = 1 + a2 * gls[k].x * gls[k].x;

                s += gls[k].w * MultiPrecision<N>.Exp( n_half_h2 * r ) / r;
            }

            MultiPrecision<N> y = s * a / (2 * MultiPrecision<N>.PI);

            return y;
        }

